import * as actionTypes from '../actions';

const initialState = {
    total: 'null',
    operation: 'null',
    next: 'null'
}

const reducer = (state = initialState, action: any) => {
    switch (action.type) {
        case actionTypes.PLUS:
            console.log('asd')
            return {
                ...state,
                total: state.total + 1
            }
        case actionTypes.MINUS:
            return {
                ...state,
                total: state.total + 1
            }
        case actionTypes.TIMES:
            return {
                ...state,
                total: state.total + action.val
            }
        case actionTypes.DIV:
            return {
                ...state,
                total: state.total + action.val
            }
    }
    return state
};

export default reducer
